В этом выпуске:
- В мире больше 700 000 заражений. В России — 2300. 30 регионов ввели режим всеобщей самоизоляции;
- Российская нефть марки Юралс подешевела до 13 долларов за баррель;
- Две трети граждан не имеют накоплений, которые позволят им пережить кризис;
- В Европе первые случаи самоубийств среди медперсонала из-за стресса и высокой нагрузки;
- Нью-Йорк таймс пишет: крупные медкорпорации годами препятствовали разработке и производству дешевых аппаратов искусственной вентиляции;
- Минздрав штата Тенессии тем временем рекомендует врачам использовать для защиты от заражения плавательные очки, подгузники, мусорные мешки и даже обычные пластиковые пакеты;
- Украина снимает-таки запрет на продажу земли;
- В США толпы людей приветствовали на набережной Гудзона плавучий военно-морской госпиталь USNS Comfort;
- 49 процентов американских компаний планируют сокращения персонала в ближайшие три месяца, гласит опрос Челленджер-Грей-энд-Кристмас;
- Пастор церкви пятидесятников Ховард из Флориды отказался отменять службы в своем храме до "наступления конца света".



